import{_ as e,c as o,o as t,a}from"./app.a6ee8b6d.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"War Treasury","slug":"war-treasury","link":"#war-treasury","children":[]}],"relativePath":"faq/1.md"}'),r={name:"faq/1.md"},i=a('<h2 id="war-treasury" tabindex="-1">War Treasury <a class="header-anchor" href="#war-treasury" aria-hidden="true">#</a></h2><p>tags: war treasury, wt</p><p>War Treasury S-ranks, S-rank Egg</p><p>Make sure you get 2 Dorm guarantees before buying cards from WT, or opening S-rank egg</p><p>Ancient Willpower valks</p><ul><li>First get SSS LE</li><li>None of the other valks are very good to invest in for use in battle</li><li>Prioritize remaining valks and ranks according to their dorm buff increase over cost; look for &quot;!faq dorm buff&quot;</li><li>To that end, I recommend S MC and S BN first</li></ul><p>Ancient Legacy valks</p><ul><li>Currently pretty tricky to invest in because FR and ME are both old (and of course CH, HR, HV, and SK are very old)</li><li>If you&#39;re not even lv 81 yet, might be good to just save your Ancient Legacy.</li><li>FR and ME should both be SSS-rank (or v close) to be competent.</li><li>If you must, I think ME could be a good bet. It would certainly be a gamble though.</li><li>FR is the best farmable lightning valk, good lightning support, but best on nothing. One path you can take is skipping HT, IO, Aponia and just farm FR copium while waiting for future options.</li><li>ME is currently top phys damage dealer in some situations. The bet for investing in her would be on Mihoyo not giving us a better option for Ranged-weak Tank.</li><li>Some more text for the people who like reading: <a href="https://discord.com/channels/418652140454674432/901268521181401108/927433678387286036" target="_blank" rel="noreferrer">https://discord.com/channels/418652140454674432/901268521181401108/927433678387286036</a></li><li>Very safe to invest in SS SK for the dorm buff.</li></ul><p>Income and farming speed</p><ul><li>Look for &quot;!faq ancient&quot; for details</li><li>In 1 year of play, it is possible to get two SSS-rank Ancient Willpower valks and more</li></ul><p>S-rank egg</p><ul><li>Ideally, save this egg until you have only 1 valk that you do not have</li><li>If you&#39;re a little more impatient, you can open it as soon as you finished your 2 Dorm guarantees, and pick a valk you do not own according to your farming priority</li><li>Picking an unowned valk roughly saves you 5 weeks of Ancient Willpower income</li></ul>',12),n=[i];function l(s,u,d,c,p,g){return t(),o("div",null,n)}const y=e(r,[["render",l]]);export{f as __pageData,y as default};
